import React from "react";

const ErrorForm = ({ item, index, remove }) => {
    const RemoveItem = () => {
        remove(index);
    };

    return (
        <div className="msg">
            <i className="fa fa-check-circle" />
            <div className="wrap-ms">
                <span className="wrap-ms-title">Sucess</span>
                <span className="wrap-ms-content">{item}</span>
            </div>
            <i className="fa fa-times" onClick={RemoveItem}></i>
        </div>
    );
};

export default ErrorForm;
